import React, { useState, useEffect } from 'react';

function Wilaya() {
  
  useEffect(() => {
    const fetchWilayas = async () => {
      const response = await fetch('http://127.0.0.1:8000/user', {
        headers: {
          'Content-Type': 'application/json',
        },
      });

      const data = await response.json();
      console.log(data);
    };

    fetchWilayas();

    // La fonction de nettoyage peut être vide si elle n'est pas nécessaire
    return () => {};
  }, []); // Assurez-vous de mettre une dépendance vide ou la dépendance nécessaire à la place

  return (
    <div className="p-4 bg-gray-100">
      <h1>hello</h1>
    </div>
  );
}

export default Wilaya;
